pragma solidity ^0.4.24;
pragma experimental ABIEncoderV2;

import "../../utils/LibBytes/LibBytes.sol";
import "../../utils/LibAssetProxyDecoder/LibAssetProxyDecoder.sol";
import "../../tokens/ERC20Token/IERC20Token.sol";
import "./MixinAssetProxy.sol";
import "./MixinAuthorizable.sol";

contract ERC20Proxy is
    LibBytes,
    LibAssetProxyDecoder,
    MixinAssetProxy,
    MixinAuthorizable
{

    // Id of this proxy.
    uint8 constant PROXY_ID = 1;

    // Revert reasons
    string constant INVALID_METADATA_LENGTH = "Metadata must have a length of 21.";
    string constant TRANSFER_FAILED = "Transfer failed.";
    string constant PROXY_ID_MISMATCH = "Proxy id in metadata does not match this proxy id.";

    /// @dev Internal version of `transferFrom`.
    /// @param proxyData Encoded byte array.
    /// @param from Address to transfer asset from.
    /// @param to Address to transfer asset to.
    /// @param amount Amount of asset to transfer.
    function transferFromInternal(
        bytes memory proxyData,
        address from,
        address to,
        uint256 amount)
        internal
    {
        // Decode proxy data.
        (
            uint8 proxyId,
            address token
        ) = decodeERC20Data(proxyData);

        // Data must be intended for this proxy.
        require(
            proxyId == PROXY_ID,
            PROXY_ID_MISMATCH
        );

        // Transfer tokens.
        bool success = IERC20Token(token).transferFrom(from, to, amount);
        require(
            success == true,
            TRANSFER_FAILED
        );
    }

    /// @dev Gets the proxy id associated with the proxy address.
    /// @return Proxy id.
    function getProxyId()
        external
        view
        returns (uint8)
    {
        return PROXY_ID;
    }
}

